import { api } from "./api"

const getInfected = async () => {
    const data = await api({
        method: "get",
        url: "/infected",
    });
    // console.log(data.data)
    return data.data;
};

const addInfected = async () => {
    await api({
        method: "POST",
        headers: {
            'Content-Type': 'Application/json'
        },
        url: "/infected",
        body: JSON.stringify({
            first_name: firstName,
            last_name: lastName,
            country: country,
            live: live,
            age: age,
            female: female
        }),
    })
}

export const infected = { getInfected, addInfected }
